column1:
We are counting on you Mr. Xi Jinping, as a law-abiding citizen yourself, 
//to reverse the practise of excessive use of force against peaceful protesters, 
//to ensure that families of all detainees are informed of their whereabouts and for those in custody to have immediate access to legal representation. 
//We also ask that you amend the law regarding peaceful assembly and freedom of expression to bring it in line with international human rights standards;
//and that you and your government account for all Tibetans who have been detained and sentenced in relation to protests, including self-immolation. 
//THEY ARE HUMAN BEINGS (LIKE YOURSELF), WHO SHARE THE ASPIRATIONS OF A PEACEFUL, FREE AND CARING SOCIETY IN WHICH TO LIVE. 
yours sincerely
GL
